/*Table structure for table `man_powers` */

DROP TABLE IF EXISTS `man_powers`;

CREATE TABLE `man_powers` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `requested_by` int unsigned NOT NULL,
  `job_title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `job_group` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `responsibilities` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `qualifications` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `benefits` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `vacancies` int unsigned NOT NULL,
  `job_nature` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `location` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `expires_at` date NOT NULL,
  `required_experience` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `department` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '0',
  `approved_by` tinyint(1) DEFAULT NULL,
  `approved_on` datetime DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `quiz_id` tinyint(1) DEFAULT NULL,
  `has_sjt` tinyint(1) NOT NULL DEFAULT '0',
  `job_level` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `man_powers` */

insert  into `man_powers`(`id`,`requested_by`,`job_title`,`job_group`,`description`,`responsibilities`,`qualifications`,`benefits`,`vacancies`,`job_nature`,`location`,`expires_at`,`required_experience`,`department`,`active`,`approved_by`,`approved_on`,`created_at`,`updated_at`,`deleted_at`,`quiz_id`,`has_sjt`,`job_level`) values (1,1,'IT Assistant','IT','The IT Assistant is a key support role within the IT department, contributing to the overall efficiency and effectiveness of an organization\'s IT infrastructure. Strong communication skills, technical proficiency, and a customer-focused mindset are essential for success in this role.','Provide first-line support for hardware, software, and network issues.\r\n\r\nAssist users in troubleshooting problems and resolving technical issues.\r\n\r\nRespond to helpdesk tickets and inquiries in a timely and efficient manner.','A degree in Information Technology, Computer Science, or a related field is  preferred.','Coverage for medical, dental, and vision expenses to help maintain the well-being of the employee.',3,'FULL_TIME','DAVAO','2024-11-12','1-2Years','IT_DEPT',1,NULL,NULL,'2023-10-10 14:50:04','2023-12-05 09:22:49',NULL,1,0,''),(2,1,'IT Engineer','IT','An IT Engineer plays a crucial role in ensuring the stability, security, and efficiency of an organization\'s IT infrastructure. The specific requirements for the role may vary based on the industry, the complexity of the IT environment, and the organization\'s size.','Responsible for designing, implementing, managing, and maintaining an organization\'s IT infrastructure. The role may involve working with a variety of technologies, including hardware, software, networks, and security systems.','A bachelor\'s degree in Information Technology, Computer Science, or a related field is required.\r\n\r\nProfessional certifications can be beneficial, such as Cisco Certified Network Professional (CCNP), Microsoft Certified: Azure Solutions Architect Expert, Certified Information Systems Security Professional (CISSP), or others depending on the specific technologies used.','Incentives based on individual or team performance, meeting project goals, or achieving milestones.\r\n\r\nComprehensive medical, dental, and vision insurance coverage for the employee and, in some cases, their dependents.',5,'FULL_TIME','NCR','2024-01-10','1-2Years','IT_DEPT',1,NULL,NULL,'2023-11-01 10:23:47','2023-12-05 09:22:49',NULL,1,0,''),(3,1,'Web Developer','IT','Professional who specializes in the development of web applications, websites, and other online solutions. Web developers typically work with programming languages, frameworks, and various technologies to create functional and visually appealing websites.','Responsible for the site\'s technical aspects, such as its performance and capacity, which are measures of a website\'s speed and how much traffic the site can handle. In addition, web developers may create content for the site.','A bachelor\'s degree in Computer Science, Software Engineering, Web Development, or a related field is preferred.','Provision of a budget or allowance for purchasing or upgrading personal technology devices.',5,'PART_TIME','NCR','2024-01-09','1-2Years','IT_DEPT',1,NULL,NULL,'2023-11-09 05:20:31','2023-12-05 09:22:50',NULL,1,0,''),(4,1,'Senior Software Developer','IT','We are currently seeking a highly skilled and motivated individual to join our Information Technology team in the role of Senior Software Developer. As a key member of our IT department, you will be responsible for designing, developing, and implementing software solutions that align with our business requirements. Collaboration with cross-functional teams is crucial in this role, as you analyze and understand project requirements, conduct code reviews, and provide constructive feedback to ensure the delivery of high-quality software solutions.\r\n\r\nThe ideal candidate will possess a Bachelor\'s degree in Computer Science or a related field and have a proven track record as a Software Developer, demonstrating expertise in relevant technologies. Strong problem-solving skills, attention to detail, and excellent communication abilities are essential, along with familiarity with agile development methodologies. In addition to contributing to the success of our projects, you will play a key role in mentoring and guiding junior developers within the team.\r\n\r\nWe offer a competitive salary package, health and dental insurance, flexible work hours, and professional development opportunities in a collaborative and innovative work environment. If you have 3 to 5 years of experience in software development and are ready to take on a challenging and rewarding role, we encourage you to apply. The position is based in the NCR, and the deadline for applications is January 31, 2024. Join us in shaping the future of our Information Technology initiatives.','Design, develop, and implement software solutions to meet business requirements.\r\nCollaborate with cross-functional teams to analyze and understand project requirements.\r\nConduct code reviews and provide constructive feedback to team members.\r\nTroubleshoot, debug, and optimize application code as needed.\r\nStay updated on industry trends and incorporate best practices into development processes.\r\nMentor and guide junior developers in the team.','Bachelor\'s degree in Computer Science or related field.\r\nProven experience as a Software Developer with expertise in [relevant technologies].\r\nStrong problem-solving skills and attention to detail.\r\nExcellent communication and teamwork abilities.\r\nFamiliarity with agile development methodologies.','Competitive salary package.\r\nHealth and dental insurance.\r\nFlexible work hours.\r\nProfessional development opportunities.\r\nCollaborative and innovative work environment.',1,'FULL_TIME','NCR','2024-01-31','1-2Years','IT_DEPT',1,NULL,NULL,'2023-11-17 04:21:40','2023-12-05 09:22:52',NULL,1,0,''),(5,1,'Human Resource Assistant','HR','We are currently looking for a dedicated and detail-oriented individual to join our Human Resources team as a Human Resource Assistant. In this role, you will play a crucial part in supporting various HR functions and ensuring the smooth operation of day-to-day activities. Your responsibilities will include assisting in recruitment processes, maintaining employee records, coordinating training programs, and providing administrative support to the HR department.','Support recruitment efforts by posting job openings, reviewing resumes, and coordinating interview schedules.\r\nAssist in onboarding processes, including the preparation of new employee documentation and orientation materials.\r\nMaintain accurate and up-to-date employee records, including personal information, attendance, and performance evaluations.\r\nHandle routine HR inquiries and provide assistance to employees regarding HR policies and procedures.\r\nCoordinate and organize training programs and events for employee development.\r\nAssist in the implementation of HR initiatives and projects.\r\nProvide general administrative support to the HR department.','Bachelor\'s degree in Human Resources, Business Administration, or related field.\r\nStrong organizational and multitasking skills.\r\nExcellent written and verbal communication abilities.\r\nProficient in Microsoft Office Suite.\r\nDemonstrated ability to maintain confidentiality and handle sensitive information.\r\nProactive and positive attitude with a willingness to learn.','Competitive salary package.\r\nHealth and dental insurance.\r\nOpportunities for professional development.\r\nCollaborative and inclusive work environment.',2,'Full-time','NCR','2024-02-15','1-2Years','HR_DEPT',1,NULL,NULL,'2023-11-17 04:35:00','2023-12-06 23:24:33',NULL,8,1,'LEVEL2'),(6,1,'Truck Driver','OPS','As a Truck Driver, you will play a pivotal role in our operations team, ensuring the safe and timely transport of goods.','Safely operate and maintain company vehicles in adherence to all traffic and safety regulations.\r\nExecute pre-trip and post-trip inspections to ensure the roadworthiness of the vehicle.\r\nTransport goods to designated locations in a timely and efficient manner.\r\nCollaborate with logistics and dispatch teams to coordinate delivery schedules.\r\nMaintain accurate records of deliveries, vehicle inspections, and fuel consumption.','Valid commercial driver\'s license (CDL) with a clean driving record.\r\nDemonstrated knowledge of and adherence to traffic laws and safety regulations.\r\nAbility to conduct routine vehicle inspections and address minor mechanical issues.\r\nExcellent time management and organizational skills.\r\nStrong communication skills and the ability to collaborate effectively with team members.','Competitive compensation package.\r\nContract-based employment with the potential for extension.\r\nOpportunities for professional development and training.\r\nSupportive and collaborative work environment.\r\nAccess to company benefits, including health and wellness programs.',3,'CONTRACT','LEGAZPI','2024-01-15','1-2Years','OPS_DEPT',1,NULL,NULL,'2023-11-17 04:46:39','2023-11-17 04:46:41',NULL,4,0,''),(7,14,'Human Resources Coordinator','HR','We are seeking a qualified individual to join our Human Resources team as a Human Resources Coordinator. The selected candidate will play a crucial role in supporting HR functions and ensuring the smooth operation of HR processes.','Assist in the coordination of HR activities and initiatives.\r\nHandle administrative tasks related to employee records and documentation.\r\nParticipate in recruitment and onboarding processes.\r\nSupport the implementation of HR policies and procedures.\r\nAssist in employee relations matters and conflict resolution.\r\nContribute to the organization and execution of HR events and training programs.','Bachelor\'s degree in Human Resources, Business Administration, or related field.\r\n1-3 years of relevant experience in human resources.\r\nStrong understanding of HR principles and practices.\r\nExcellent communication and interpersonal skills.\r\nProficient in MS Office applications.\r\nAbility to handle confidential information with discretion.','We offer competitive benefits including health insurance, retirement plans, and professional development opportunities. Joining our team provides a chance to work in a dynamic and collaborative HR environment.',1,'FULL_TIME','NCR','2024-01-15','1-2Years','HR_DEPT',0,NULL,NULL,'2023-11-22 12:17:40','2023-11-22 12:22:52',NULL,3,0,''),(8,14,'Human Resource Manager','HR','A human resources (HR) manager is someone who oversees the administrative and organizational functions of a company or business. The manager usually heads the HR department, and they play an important role as a bridge between management and employees.','HR Manager responsibilities include:\r\nDeveloping and implementing HR strategies and initiatives aligned with the overall business strategy\r\nBridging management and employee relations by addressing demands, grievances or other issues\r\nManaging the recruitment and selection process','roeuwtjowiejtoa','garwywharhawha',4,'FULL_TIME','DAVAO','2024-03-14','1-2Years','HR_DEPT',1,NULL,NULL,'2023-11-25 06:22:10','2023-11-25 06:30:10',NULL,3,0,''),(9,14,'sdsada','HR','sadasd','asdsadsada','asdsda','dsadsa',4,'FULL_TIME','NCR','2023-11-28','1-2Years','IT_DEPT',0,NULL,NULL,'2023-11-25 07:16:33','2023-12-01 15:05:58',NULL,1,0,''),(10,145,'Executive VP of Operations','OPS','The VP of Operations is a leadership role that manages the efficiency of an organization. A VP of Operations tracks industry changes and recommends processes to improve organizational goals and processes. A VP of Operations develops new processes and makes recommendations for streamlining processes based on research by other Operations employees. Monitoring profit margins and employee productivity are also tasks of a VP Of Operations.','Operational Efficiency Management:\r\n\r\nOversee and optimize operational processes to ensure efficiency, cost-effectiveness, and alignment with organizational goals.\r\nIndustry Analysis:\r\n\r\nStay abreast of industry trends, market changes, and emerging technologies, providing insights and recommendations for adapting operational strategies accordingly.\r\nProcess Improvement:\r\n\r\nDevelop and implement new processes, and recommend improvements to existing processes based on research and insights gathered from the Operations team.\r\nProfit Margin Monitoring:\r\n\r\nAnalyze and monitor profit margins, identifying areas for improvement and implementing strategies to enhance overall profitability.\r\nEmployee Productivity Oversight:\r\n\r\nSupervise and evaluate employee productivity, implementing measures to enhance team performance and efficiency.\r\nStrategic Recommendations:\r\n\r\nMake strategic recommendations to senior management based on data analysis, industry insights, and operational efficiency assessments.','Proven Leadership Experience:\r\n\r\nSubstantial experience in a leadership role, preferably as a VP of Operations or in a similar capacity.\r\nIndustry Knowledge:\r\n\r\nIn-depth understanding of the industry, market trends, and operational best practices.\r\nAnalytical Skills:\r\n\r\nStrong analytical and problem-solving skills, with the ability to make data-driven decisions.\r\nProcess Improvement Expertise:\r\n\r\nDemonstrated expertise in developing and implementing efficient operational processes.\r\nFinancial Acumen:\r\n\r\nSolid understanding of financial principles and the ability to monitor and improve profit margins.\r\nTeam Management Skills:\r\n\r\nProven ability to lead and motivate teams, driving productivity and achieving operational excellence.','Competitive Compensation:\r\n\r\nAttractive salary and performance-based bonuses.\r\nComprehensive Health Benefits:\r\n\r\nHealth insurance coverage for employees and their dependents.\r\nProfessional Development Opportunities:\r\n\r\nAccess to training programs and workshops to enhance skills and foster career growth.\r\nFlexible Work Arrangements:\r\n\r\nOpportunities for flexible work schedules and remote work options.\r\nDynamic Work Environment:\r\n\r\nCollaborative and innovative work culture that encourages creativity and problem-solving.\r\nCareer Advancement Opportunities:\r\n\r\nClear paths for career progression within the organization.',1,'FULL_TIME','NCR,Manila','2023-12-03','1-2Years','OPS_DEPT',1,NULL,NULL,'2023-12-01 14:11:10','2023-12-01 14:18:00',NULL,NULL,0,'Level5'),(11,1,'Sample Success Rate','IT','Sample','Sample','Sample','Sample',2,'FULL_TIME','LEGAZPI','2023-12-21','1-2Years','IT_DEPT',1,NULL,NULL,'2023-12-02 03:28:10','2023-12-02 03:36:19',NULL,NULL,0,'LEVEL2'),(12,1,'Sample Success Rate 2','MECH','Sample','Sample','Sample','Sample',2,'PART_TIME','DAVAO','2023-12-03','1-2Years','OPS_DEPT',1,NULL,NULL,'2023-12-02 03:28:53','2023-12-02 19:38:49',NULL,NULL,0,'Level1'),(13,1,'Data Analyst','OPS','Sample','Sample','Sample','Sample',3,'Full-time','CEBU','2023-12-04','1-2Years','ResearchandDevelopment',0,NULL,NULL,'2023-12-02 03:29:41','2023-12-05 21:08:37',NULL,NULL,0,'Level4'),(14,145,'Truck Driver',NULL,'Drive da truck','Deliver da package','Can drive and prioritize the package','Hab salary',1,'Full-time','LEGAZPI','2024-01-12','1-2Years','OPS_DEPT',0,NULL,NULL,'2023-12-04 01:04:34','2023-12-04 01:04:34',NULL,7,1,'Level1'),(15,1,'Director of Operations',NULL,'U direct','U get gud directing','100 years experience\r\n20 PhD\'s','a lot',1,'Full-time','PAMPANGA','2024-01-01','1-2Years','OPS_DEPT',1,NULL,NULL,'2023-12-04 16:16:38','2023-12-04 16:16:44',NULL,8,1,'Level8');

